  false,\n\t\"url\": null,\n\t\"notes\": \"The gravity station data total 9416 records.
  This data base was received in March 1997. Principal gravity parameters include
  Free-air Anomalies which have been adjusted to the International Gravity Standardization
  Net 1971 (IGSN 71). The gravity anomaly computation uses the Geodetic Reference
  System 1967 (GRS67) theoretical gravity formula. The data are randomly distributed
  within the area approx. bounded by 61 to 66 degrees latitude and 144 to 159 degrees
  longitude in the interior of Alaska, In addition, the data has been gridded and
  maps have been recently published through the USGS, Map GP-1016.\",\n\t\"owner_org\":
